import React from "react";
import { Avatar } from "antd";

export const ContactsToSelect = () => {
return( 
    <div
        className="ct-chat-user-item " >
        <div className="ct-chat-user-row">
          <div className="ct-chat-avatar">
            <div className="ct-status-pos">
              <Avatar src={""} className="ct-size-50" alt="Abbott" />
            </div>
          </div>

          <div className="ct-chat-contact-col">
            <div className="ct-chat-user-name">{/* contact.name */}</div>
            <div className="ct-chat-user-des ct-text-truncate">{/* contact.email */}</div>
          </div>
          </div>
        </div>
    );
}
